     1→import axios from 'axios';
     2→import type { CandleData } from '../types/coinbase';
     3→import { RateLimiter } from './rateLimiter';
     4→
     5→export class CoinbaseAPI {
     6→  private baseUrl = import.meta.env.DEV ? '/api/coinbase' : 'https://api.exchange.coinbase.com';
     7→  private rateLimiter = new RateLimiter(10, 3); // 10 requests per second, max 3 concurrent
     8→  
     9→  constructor() {
    10→    // Add response error interceptor only
    11→    axios.interceptors.response.use(
    12→      response => response,
    13→      error => {
    14→        console.error('API Error:', error.message);
    15→        if (error.response) {
    16→          console.error('Response data:', error.response.data);
    17→          console.error('Response status:', error.response.status);
    18→        }
    19→        return Promise.reject(error);
    20→      }
    21→    );
    22→  }
    23→
    24→  async getCandles(
    25→    productId: string = 'BTC-USD',
    26→    granularity: number = 60, // 1 minute
    27→    start?: string,
    28→    end?: string
    29→  ): Promise<CandleData[]> {
    30→    // Create a unique key for this request for rate limiting
    31→    const key = `candles-${productId}-${granularity}-${start || 'latest'}-${end || 'now'}`;
    32→    
    33→    return this.rateLimiter.execute(key, async () => {
    34→      
    35→      // Validate time range to prevent future data requests
    36→      const now = Math.floor(Date.now() / 1000);
    37→      if (end && parseInt(end) > now) {
    38→        console.warn(`Attempted to fetch future data. Capping end time at now.`);
    39→        end = now.toString();
    40→      }
    41→      
    42→      if (start && parseInt(start) > now) {
    43→        console.warn(`Start time is in the future. Returning empty array.`);
    44→        return [];
    45→      }
    46→      
    47→      const params: any = {
    48→        granularity
    49→      };
    50→
    51→      if (start) params.start = start;
    52→      if (end) params.end = end;
    53→
    54→      const url = `${this.baseUrl}/products/${productId}/candles`;
    55→      
    56→      const response = await axios.get(url, { params });
    57→      
    58→      // Coinbase returns candles in reverse chronological order
    59→      // Format: [timestamp, price_low, price_high, price_open, price_close, volume]
    60→      const candles = response.data.reverse().map((candle: number[]) => ({
    61→        time: candle[0], // Already in seconds
    62→        open: candle[3],
    63→        high: candle[2],
    64→        low: candle[1],
    65→        close: candle[4],
    66→        volume: candle[5]
    67→      }));
    68→      
    69→      return candles;
    70→    }).catch(error => {
    71→      if (axios.isAxiosError(error) && error.response?.status !== 429) {
    72→        console.error('Coinbase API error:', error.response?.status, error.response?.data);
    73→      }
    74→      throw error;
    75→    });
    76→  }
    77→
    78→  async getTicker(productId: string = 'BTC-USD'): Promise<number> {
    79→    const key = `ticker-${productId}`;
    80→    
    81→    return this.rateLimiter.execute(key, async () => {
    82→      const response = await axios.get(`${this.baseUrl}/products/${productId}/ticker`);
    83→      return parseFloat(response.data.price);
    84→    }).catch(error => {
    85→      console.error('Error fetching Coinbase ticker:', error);
    86→      throw error;
    87→    });
    88→  }
    89→}

