   590→  // Reload data with current period and granularity
   591→  // Debounced reload data function to prevent rapid successive calls
   592→  function debouncedReloadData() {
   593→    clearTimeout(reloadDebounceTimer);
   594→    reloadDebounceTimer = setTimeout(() => {
   595→      reloadData();
   596→    }, 100); // 100ms debounce
   597→  }
   598→  
   599→  export async function reloadData() {
   600→    if (!chart || !dataFeed || !candleSeries || isLoadingData) return;
   601→    
   602→    isLoadingData = true;
   603→    
   604→    try {
   605→      // Calculate time range based on period - USE FRESH DATE
   606→      const now = Math.floor(Date.now() / 1000);
   607→      const currentDateTime = new Date();
   608→      console.log(`🕐 RELOAD TIME: ${currentDateTime.toLocaleString()} (Unix: ${now})`);
   609→      const days = periodToDays[period] || 1;
   610→      const periodSeconds = days * 86400;
   611→      
   612→      // Get granularity for alignment
   613→      const granularitySeconds = granularityToSeconds[effectiveGranularity] || 60;
   614→      
   615→      // Align times to granularity boundaries for exact candle counts
   616→      let alignedNow = Math.floor(now / granularitySeconds) * granularitySeconds;
   617→      
   618→      // For daily candles, don't align to past midnight
   619→      if (effectiveGranularity === '1D') {
   620→        // Use current time for daily candles to include today's data
   621→        // Aligning to midnight would exclude today's candle
   622→        alignedNow = now;
   623→      }
   624→      
   625→      const startTime = alignedNow - periodSeconds;
   626→      
   627→      // Force manual mode to ensure our selected granularity is used
   628→      dataFeed.setManualGranularity(effectiveGranularity);
   629→      
   630→      // Get data for the period using ChartDataFeed API
   631→      console.log(`Loading ${period} data with ${effectiveGranularity} candles...`);
   632→      const data = await dataFeed.getDataForVisibleRange(startTime, alignedNow);
   633→      
   634→      // CRITICAL: Filter data to only include candles within our time range
   635→      const filteredData = data.filter(candle => 
   636→        candle.time >= startTime && candle.time <= alignedNow
   637→      );
   638→      
   639→      // Calculate expected candles
   640→      const expectedCandles = Math.ceil(periodSeconds / granularitySeconds);
   641→      
   642→      // Update date range info for reload
   643→      dateRangeInfo.expectedFrom = new Date(startTime * 1000).toLocaleString();
   644→      dateRangeInfo.expectedTo = new Date(alignedNow * 1000).toLocaleString();
   645→      dateRangeInfo.expectedCandles = expectedCandles;
   646→      dateRangeInfo.actualCandles = filteredData.length;
   647→      dateRangeInfo.requestedFrom = startTime;
   648→      dateRangeInfo.requestedTo = alignedNow;
   649→      
   650→      if (filteredData.length > 0) {
   651→        const firstCandle = filteredData[0];
   652→        const lastCandle = filteredData[filteredData.length - 1];
   653→        dateRangeInfo.actualFrom = new Date(firstCandle.time * 1000).toLocaleString();
   654→        dateRangeInfo.actualTo = new Date(lastCandle.time * 1000).toLocaleString();
   655→        dateRangeInfo.dataDebug = `First: ${firstCandle.time}, Last: ${lastCandle.time}`;
   656→      }
   657→      
   658→      console.log(`Reloading: ${filteredData.length} candles (expected ${expectedCandles}) for ${period} with ${effectiveGranularity}`);
   659→      
   660→      // Verify candle count and update status
   661→      if (filteredData.length === 0) {
   662→        console.warn(`⚠️ No data available yet for ${period}. Data may still be loading...`);
   663→        status = 'loading';
   664→      } else if (filteredData.length < expectedCandles * 0.5) {
   665→        console.warn(`⚠️ Only ${filteredData.length} of ${expectedCandles} candles loaded. Historical data is still downloading...`);
   666→        // Still show what we have but indicate loading
   667→        status = 'loading';
   668→      } else if (Math.abs(filteredData.length - expectedCandles) > 1) {
   669→        console.warn(`⚠️ Candle count mismatch on reload! Expected ${expectedCandles}, got ${filteredData.length}`);
   670→      } else {
   671→        status = 'connected';
   672→        errorMessage = ''; // Clear any previous errors
   673→      }
   674→      
   675→      if (filteredData.length > 0) {
   676→        const chartData = filteredData.map(candle => ({
   677→          ...candle,
   678→          time: candle.time as Time
   679→        }));
   680→        
   681→        // Update chart data
   682→        candleSeries.setData(chartData);
   683→        
   684→        // Force the specific range we want
   685→        setTimeout(() => {
   686→          chart.timeScale().setVisibleRange({
   687→            from: startTime as Time,
   688→            to: alignedNow as Time
   689→          });
   690→        }, 50);
   691→        
   692→        // Update visible candle count
   693→        updateVisibleCandleCount(startTime, alignedNow);
   694→        
   695→        // Verify the range after a short delay
   696→        setTimeout(() => {
   697→          const actualRange = chart?.timeScale().getVisibleRange();
   698→          if (actualRange) {
   699→            // Always update with the actual visible range
   700→            updateVisibleCandleCount(Number(actualRange.from), Number(actualRange.to));
   701→          }
   702→        }, 100);
   703→      }
   704→    } catch (error: any) {
   705→      console.error('Error reloading data:', error);
   706→      if (error?.response?.status === 429) {
   707→        errorMessage = 'Rate limit exceeded. Please wait a moment and try again.';
   708→      } else {
   709→        errorMessage = `Failed to reload data: ${error.message || 'Unknown error'}`;
   710→      }
   711→    } finally {
   712→      isLoadingData = false;
   713→    }
   714→  }
