   717→  // Update visible candle count
   718→  function updateVisibleCandleCount(fromTime: number, toTime: number) {
   719→    if (!dataFeed) {
   720→      visibleCandleCount = 0;
   721→      return;
   722→    }
   723→    
   724→    // Calculate actual candle count based on granularity
   725→    const range = toTime - fromTime;
   726→    const granularitySeconds = granularityToSeconds[effectiveGranularity] || 60;
   727→    visibleCandleCount = Math.ceil(range / granularitySeconds);
   728→    
   729→    // Debug logging
   730→    // Show expected counts for common scenarios
   731→    const expectedCounts: Record<string, Record<string, number>> = {
   732→      '1H': { '1m': 60, '5m': 12, '15m': 4, '1h': 1 },
   733→      '4H': { '1m': 240, '5m': 48, '15m': 16, '1h': 4 },
   734→      '5D': { '1m': 7200, '5m': 1440, '15m': 480, '1h': 120, '6h': 20, '1d': 5 },
   735→      '1M': { '1h': 720, '6h': 120, '1d': 30 },
   736→      '3M': { '1h': 2160, '6h': 360, '1d': 90 },
   737→      '6M': { '1d': 180 },
   738→      '1Y': { '1d': 365 },
   739→      '5Y': { '1d': 1825 }
   740→    };
   741→    
   742→    const expected = expectedCounts[period]?.[effectiveGranularity];
   743→    
   744→    console.log('Visible candle count:', {
   745→      period,
   746→      granularity: effectiveGranularity,
   747→      visibleCount: visibleCandleCount,
   748→      expected: expected || 'calculated',
   749→      isCorrect: expected ? Math.abs(visibleCandleCount - expected) <= 1 : 'N/A'
   750→    });
   751→  }
   752→
   753→  // Update total candle count
   754→  async function updateTotalCandleCount() {
   755→    if (!dataFeed) return;
   756→    
   757→    try {
   758→      totalCandleCount = await dataFeed.getTotalCandleCount();
   759→    } catch (error) {
   760→      console.error('Error getting total candle count:', error);
   761→    }
   762→  }
   763→
   764→  // Update clock and countdown
   765→  function updateClock() {
   766→    const now = new Date();
   767→    const nowSeconds = Math.floor(now.getTime() / 1000);
   768→    
   769→    // Format current time
   770→    const hours = now.getHours().toString().padStart(2, '0');
   771→    const minutes = now.getMinutes().toString().padStart(2, '0');
   772→    const seconds = now.getSeconds().toString().padStart(2, '0');
   773→    currentTime = `${hours}:${minutes}:${seconds}`;
   774→    
   775→    // Calculate countdown to next candle using effective granularity
   776→    const granularitySeconds = granularityToSeconds[effectiveGranularity] || 60;
   777→    const currentMinuteBoundary = Math.floor(nowSeconds / 60) * 60;
   778→    const nextMinuteBoundary = currentMinuteBoundary + 60;
   779→    
   780→    // For 1m granularity, countdown to next minute boundary
   781→    let secondsUntilNextCandle;
   782→    if (effectiveGranularity === '1m') {
   783→      secondsUntilNextCandle = nextMinuteBoundary - nowSeconds;
   784→    } else {
   785→      // For other granularities, calculate based on period boundaries
   786→      const secondsIntoCurrentCandle = nowSeconds % granularitySeconds;
   787→      secondsUntilNextCandle = granularitySeconds - secondsIntoCurrentCandle;
   788→    }
   789→    
   790→    // Format countdown
   791→    if (secondsUntilNextCandle >= 3600) {
   792→      const h = Math.floor(secondsUntilNextCandle / 3600);
   793→      const m = Math.floor((secondsUntilNextCandle % 3600) / 60);
   794→      const s = secondsUntilNextCandle % 60;
   795→      countdown = `${h}h ${m.toString().padStart(2, '0')}m ${s.toString().padStart(2, '0')}s`;
   796→    } else if (secondsUntilNextCandle >= 60) {
   797→      const m = Math.floor(secondsUntilNextCandle / 60);
   798→      const s = secondsUntilNextCandle % 60;
   799→      countdown = `${m}m ${s.toString().padStart(2, '0')}s`;
   800→    } else {
   801→      countdown = `${secondsUntilNextCandle}s`;
   802→    }
   803→  }
   804→
   805→  onDestroy(() => {
   806→    if (clockInterval) {
   807→      clearInterval(clockInterval);
   808→    }
   809→    if (updateTimer) {
   810→      clearTimeout(updateTimer);
   811→    }
   812→    if (reloadDebounceTimer) {
   813→      clearTimeout(reloadDebounceTimer);
   814→    }
   815→    if (resizeHandler) {
   816→      window.removeEventListener('resize', resizeHandler);
   817→    }
   818→    if (dataFeed) {
   819→      dataFeed.unsubscribe('chart');
   820→      dataFeed.disconnect();
   821→    }
   822→    if (chart) {
   823→      chart.remove();
   824→    }
   825→  });
   826→</script>
